DROP DATABASE IF EXISTS `orion_health_insurance`;
CREATE DATABASE `orion_health_insurance`;
USE `orion_health_insurance`;

-- Members table
CREATE TABLE orion_health_insurance_members (
    member_id VARCHAR(20) PRIMARY KEY,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    birth_date DATE NOT NULL,
    gender ENUM('Male', 'Female') NOT NULL,
    preferred_language ENUM('English', 'Spanish', 'Bilingual') NOT NULL,
    enrollment_status ENUM('Active', 'Inactive') NOT NULL,
    member_since DATE NOT NULL,
    smoking_status ENUM('Smoker', 'Non-Smoker') NOT NULL,
    alcohol_consumption ENUM('None', 'Moderate', 'Heavy') NOT NULL,
    activity_level ENUM('Sedentary', 'Active', 'Very Active') NOT NULL,
    state VARCHAR(50) NOT NULL,
    address VARCHAR(100),
    phone VARCHAR(20),
    email VARCHAR(100)
) ENGINE=InnoDB COMMENT 'Stores member details';

