-- EHR table
CREATE TABLE orion_health_insurance_ehr (
    ehr_id INT AUTO_INCREMENT PRIMARY KEY,
    member_id VARCHAR(20) NOT NULL,
    claim_id INT NOT NULL,
    record_type ENUM('Vitals', 'Lab Results', 'Imaging', 'Procedure', 'Diagnosis', 'Surgery', 'Medication', 'Other') NOT NULL,
    record_date DATE NOT NULL,
    description TEXT,
    provider_name VARCHAR(100) NOT NULL,
    icd_code VARCHAR(10),
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    FOREIGN KEY (member_id) REFERENCES orion_health_insurance_members(member_id) ON DELETE RESTRICT ON UPDATE CASCADE,
    FOREIGN KEY (claim_id) REFERENCES orion_health_insurance_claims(claim_id) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE=InnoDB COMMENT 'Stores electronic health record details';

