-- Metrics table
CREATE TABLE orion_health_insurance_metrics (
    metric_id INT AUTO_INCREMENT PRIMARY KEY,
    period_start DATE NOT NULL,
    period_end DATE NOT NULL,
    total_members INT NOT NULL,
    total_claims INT NOT NULL,
    total_claim_amount DECIMAL(12,2) NOT NULL,
    total_premium_revenue DECIMAL(12,2) NOT NULL,
    claims_paid INT NOT NULL,
    claims_denied INT NOT NULL,
    average_claim_amount DECIMAL(10,2) NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB COMMENT 'Stores monthly performance metrics';

